#!/usr/bin/env python

from StringIO import StringIO
import unittest
import sys

sys.setrecursionlimit(4000)


def resolve(ciphertext, allWords):
    allWords = set(allWords)
    solutions = list()
    translationTable = dict()
    usedLetters = set()

    prefixes = dict()
    for word in allWords:
        if len(word) not in prefixes:
            prefixes[len(word)] = set()
        for n in range(len(word)+1):
            prefixes[len(word)].add(word[:n])

    wordLengths = list()
    wordLen = 0
    for c in ciphertext:
        if c == " ":
            wordLengths.extend([wordLen] * wordLen)
            wordLen = 0
            wordLengths.append(0)
        else:
            wordLen += 1
    wordLengths.extend([wordLen] * wordLen)
    # v kazde pozici ted budeme vedet, v jak dlouhem slove jsme

    def process(pos, currentWord):
        if pos == len(ciphertext):
            # found one solution
            plaintext = "".join(" " if c == " " else translationTable[c] for c in ciphertext)
            solutions.append(plaintext)
            return

        c = ciphertext[pos]
        wordLength = wordLengths[pos]

        if c == " ":
            if currentWord in allWords:
                process(pos+1, "")

        elif c in translationTable:
            # just check that a proper plaintext word exist
            currentWord += translationTable[c]
            if currentWord in prefixes[wordLength]:
                process(pos+1, currentWord)

        else:
            # figure out a letter that could pass
            for letter in "abcdefghijklmnopqrstuvwxyz":
                if letter in usedLetters:
                    # letter already taken
                    continue

                if (currentWord+letter) in prefixes[wordLength]:
                    translationTable[c] = letter
                    usedLetters.add(letter)

                    process(pos+1, currentWord+letter)

                    del translationTable[c]
                    usedLetters.remove(letter)

    process(0, "")
    return solutions


class Tests (unittest.TestCase):

    def test_empty(self):
        res = resolve("", [])
        self.assertEqual(res, [""])

    def test_sample1(self):
        ciphertext = "kpz ift op ifu"
        words = ['dog', 'six', 'is', 'no', 'joe', 'hat', 'has', 'fat']
        res = resolve(ciphertext, words)
        self.assertEqual(res, [
            "dog has no hat",
            "dog hat no has",
            "joe has no hat",
            "joe hat no has"])

    def test_pub00(self):
        words = (
            "a b c"
        ).split()
        ciphertext = (
            "x y z x y z"
        )
        res = resolve(ciphertext, words)
        self.assertEqual(res, [
            "a b c a b c",
            "a c b a c b",
            "b a c b a c",
            "b c a b c a",
            "c a b c a b",
            "c b a c b a"
        ])

